import React from 'react';
import {useEffect, useState} from "react";
import axios from "axios";
import './App.css';
import * as url from "url";

function App() {

    const [pokemons, getNewPokemons] = useState(null);

    useEffect(() => {
        axios({method: "get",
            url: "https://pokeapi.co/api/v2/pokedex/kanto/",})
            .then((response)=>{
                const data = response.data
                getNewPokemons(data)
            })
    })


  return (
    <div className="App">

    </div>
  );
}

export default App;
